import logo from './logo.svg';
import './App.css';
function Header(props){
  return(
  <header><a href="#"><h1>{props.title}</h1></a></header>
  )
}

function Nav(){
  return(
    <ol>
      <li><a href="#">html</a></li>
      <li><a href="#">css</a></li>
      <li><a href="#">js</a></li>
    </ol>
  )
}

function Article(props){
  return(
    <article>
      <h2>{props.title}</h2>
      {props.body}
    </article>
  )
}

function App() {
  return (
    <div>
      <Header title="html"></Header>
      <Nav></Nav>
      <Article title="Welcom" body="Hello, WEB"></Article>
    </div>
  );
}

export default App;
